import {
    dbs_4,
    racks_4,
    dbRackConnections_4
} from "../Layout/floor4_layout.jsx";

import {
    dbs_15,
    racks_15,
    workdesks_15,
} from "../Layout/floor15_layout.jsx";


export const floorData = {
    4: {
        floorId: 4,
        dbs: dbs_4,
        racks: racks_4,
        connections: dbRackConnections_4,
    },
    15: {
        floorId: 15,
        dbs: dbs_15,    
        racks: racks_15,
        workdesks: workdesks_15
    }
};
